import React from "react";
import CourseChapters from "./CourseChapters/CourseChapters";
import "./CourseChapters/CourseChapters.css";
import "./CourseDetails.css"
import { Container } from "react-bootstrap";

const CourseDetail = () => {
  return (
    <React.Fragment>
      <Container className = "details-container">
        <h1 className="heading">Curriculum</h1>
        
        <div className="course-chapters">
          <hr />
          <CourseChapters title="A" lecture="LECTURE 1.1">
            <span className="accordion-text">aaaaaa</span>
          </CourseChapters>
          <hr />
          <CourseChapters title="B" lecture="LECTURE 1.2">
            <span className="accordion-text">bbbbbb</span>
          </CourseChapters>
          <hr />
          <CourseChapters title="C" lecture="LECTURE 1.3">
            <span className="accordion-text">cccccc</span>
          </CourseChapters>
          <hr />
        </div>
      </Container>
    </React.Fragment>
  );
};

export default CourseDetail;
